INSERT INTO "public"."Internalization" VALUES ('e3f70933-59ad-4504-9a51-03067aa1e484', 'introduction', '9eac8021-68e5-4458-962e-a9dbb92cd842', 'Vue3 Admin 是一个基于 Nest.js 全栈开发的后台管理系统，前台在 SoybeanAdmin 的基础上二次开发，完成了常规后台项目的功能，开箱即用，非常适合新手开发者学习借鉴。', 'Vue3 Admin is a background management system based on Nest.js full stack development, the foreground in SoybeanAdmin on the basis of secondary development, completed the functions of the regular background project, out of the box, very suitable for novice developers to learn from', 'Vue3 Adminはnest.jsのフルスタックに基づいて開発されたバックグランド管理システムです。フロントはSoybeanAdminの基礎の上で二次開発して、通常のバックグランドプロジェクトの機能を完成しました', 'Vue3 Admin 是一個基於 Nest.js 全棧開發的後臺管理系統，前臺在 SoybeanAdmin 的基礎上二次開發，完成了常規後臺項目的功能，開箱即用，非常適合新手開發者學習借鑒。', '2024-08-15 10:15:38.933', '2024-08-16 07:59:52.864');
