INSERT INTO "public"."Internalization" VALUES ('f6c58c3e-f73b-4d39-a78d-d79d96094088', 'subTitle', 'c13f4af8-97f3-4ef7-a9a6-dff36f7310e2', '验证码的主要用途是为了防止自动化程序（如机器人、爬虫等）恶意访问网站或应用程序，从而保护系统的安全性和数据的完整性，单纯前端的验证是不安全的，因为可以直接通过接口请求', 'The main purpose of captCHA is to prevent automated programs (such as robots, crawlers, etc.) from accessing websites or applications maliciously, so as to protect the security of the system and the integrity of the data. Simple front-end verification is not secure, because it can be requested directly through the interface', 'captchaの主な用途は、自動化プログラム(ロボット、クローラなど)がウェブサイトやアプリケーションに悪意を持ってアクセスするのを防ぎ、システムの安全性とデータの完全性を保護するためです。フロントエンドの検証だけでは、インターフェイス上で直接要求できるので安全ではありません', '驗證碼的主要用途是為了防止自動化程序（如機器人、爬蟲等）惡意訪問網站或應用程序，從而保護系統的安全性和數據的完整性，單純前端的驗證是不安全的，因為可以直接通過接口請求', '2024-09-10 07:15:38.675', '2024-09-10 07:15:38.675');
